import React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';

function colorCans(hexCode){
  return `https://img.icons8.com/external-vitaliy-gorbachev-fill-vitaly-gorbachev/100/${hexCode}/external-soda-fast-food-vitaliy-gorbachev-fill-vitaly-gorbachev.png`
}

export default function InventoryCard(props) {
  return (
    <Card className="sodaCanCard" sx={{ maxWidth: 345 }}>
      <CardMedia
        component="img"
        alt="Soda Can"
        className='sodaCanCardImg'
        image={colorCans(props.soda.hexColorCode)}
      />
      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          {props.soda.name}
        </Typography>
        <Typography variant="body2" color="text.secondary">
          {props.soda.desc}
        </Typography>
      </CardContent>
      <CardActions>
        <Button size="small" variant="outlined" >Restock</Button>
        <Button size="small">Qty:{props.soda.quantity}</Button>
        <Button size="small">MaxQty:{props.soda.maxQuantity}</Button>
      </CardActions>
    </Card>
  );
}
